/**
 * Get bit masks for routing based on routing level
 * @return
 */
private int[] getMasks() {
  int[] masks;
  if(triLevel)
    masks = getBitMasks(numBits[0], numBits[1]);
  else
    masks = getBitMasks(numBits[0]);

  return masks;
}

